import{_ as n,c as s,o as t,a}from"./app.934d5048.js";const g='{"title":"\u4EFB\u52A1\u961F\u5217","description":"","frontmatter":{},"headers":[{"level":3,"title":"\u4EFB\u52A1\u961F\u5217","slug":"\u4EFB\u52A1\u961F\u5217"},{"level":3,"title":"\u5206\u6790\u793A\u4F8B\u4EE3\u7801","slug":"\u5206\u6790\u793A\u4F8B\u4EE3\u7801"},{"level":3,"title":"\u603B\u7ED3","slug":"\u603B\u7ED3"}],"relativePath":"JavaScript/\u4E00\u7BC7\u6587\u7AE0\u641E\u61C2\u4E8B\u4EF6\u5FAA\u73AF\u673A\u5236/\u4E00\u7BC7\u6587\u7AE0\u641E\u61C2\u4E8B\u4EF6\u5FAA\u73AF\u673A\u5236.md","lastUpdated":1645364717000}',o={},e=a(`<p>\u4E3A\u4E86\u534F\u8C03\u4E8B\u4EF6\u3001\u7528\u6237\u4EA4\u4E92\u3001\u811A\u672C\u3001UI \u6E32\u67D3\u548C\u7F51\u7EDC\u5904\u7406\u7B49\u884C\u4E3A\uFF0C\u7528\u6237\u5F15\u64CE\u5FC5\u987B\u4F7F\u7528 event loops\u3002Event Loop \u5305\u542B\u4E24\u7C7B\uFF1A\u4E00\u7C7B\u662F\u57FA\u4E8E Browsing Context \uFF0C\u4E00\u79CD\u662F\u57FA\u4E8E Worker \uFF0C\u4E8C\u8005\u662F\u72EC\u7ACB\u8FD0\u884C\u7684\u3002|</p><p>\u53C2\u8003\uFF1A</p><ol><li><p><a href="https://www.cnblogs.com/yugege/p/9598265.html" target="_blank" rel="noopener noreferrer">\u6DF1\u5165\u7406\u89E3 Javascript \u4E8B\u4EF6\u5904\u7406\u673A\u5236</a></p></li><li><p><a href="https://jakearchibald.com/2015/tasks-microtasks-queues-and-schedules/" target="_blank" rel="noopener noreferrer">Tasks, microtasks, queues and schedules</a></p></li></ol><p>JavaScript \u662F\u4E00\u95E8\u5355\u7EBF\u7A0B\u8BED\u8A00\uFF0C\u867D\u7136\u5728 html5 \u4E2D\u63D0\u51FA\u4E86 Web-Worker \uFF0C\u4F46\u8FD9\u5E76\u672A\u6539\u53D8 JavaScript \u662F\u5355\u7EBF\u7A0B\u8FD9\u4E00\u6838\u5FC3\u3002</p><p><strong>\u4E3A\u4E86\u534F\u8C03\u4E8B\u4EF6\u3001\u7528\u6237\u4EA4\u4E92\u3001\u811A\u672C\u3001UI \u6E32\u67D3\u548C\u7F51\u7EDC\u5904\u7406\u7B49\u884C\u4E3A\uFF0C\u7528\u6237\u5F15\u64CE\u5FC5\u987B\u4F7F\u7528 event loops\u3002Event Loop \u5305\u542B\u4E24\u7C7B\uFF1A\u4E00\u7C7B\u662F\u57FA\u4E8E Browsing Context \uFF0C\u4E00\u79CD\u662F\u57FA\u4E8E Worker \uFF0C\u4E8C\u8005\u662F\u72EC\u7ACB\u8FD0\u884C\u7684</strong>\u3002</p><div class="language-js"><pre><code>console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">&quot;script start&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

<span class="token function">setTimeout</span><span class="token punctuation">(</span><span class="token keyword">function</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
  console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">&quot;setTimeout&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token punctuation">}</span><span class="token punctuation">,</span> <span class="token number">0</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

Promise<span class="token punctuation">.</span><span class="token function">resolve</span><span class="token punctuation">(</span><span class="token punctuation">)</span>
  <span class="token punctuation">.</span><span class="token function">then</span><span class="token punctuation">(</span><span class="token keyword">function</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
    console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">&quot;promise1&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
  <span class="token punctuation">}</span><span class="token punctuation">)</span>
  <span class="token punctuation">.</span><span class="token function">then</span><span class="token punctuation">(</span><span class="token keyword">function</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
    console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">&quot;promise2&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
  <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

console<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span><span class="token string">&quot;script end&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre></div><p>\u8F93\u51FA\u7ED3\u679C\uFF1A</p><div class="language-js"><pre><code>script start
script end
promise1
promise2
setTimeout
</code></pre></div><p>\u6CA1\u60F3\u5230\u5427\uFF0C promise \u548C setTimeout \u5230\u5E95\u662F\u600E\u4E48\u56DE\u4E8B\uFF1F \u8BB2\u9053\u7406\uFF0C\u5982\u679C\u4F60\u5B66\u4F1A javascript \u7684\u4E8B\u4EF6\u5FAA\u73AF\u673A\u5236\uFF0C \u4F60\u5C06\u4F1A\u8D85\u8FC7\u56FD\u5185 80% \u4EE5\u4E0A\u7684\u524D\u7AEF\u5F00\u53D1\u5DE5\u7A0B\u5E08\u3002</p><p>\u8BB2\u4E00\u4E2A\u77E5\u8BC6\u70B9\u3002</p><h3 id="\u4EFB\u52A1\u961F\u5217" tabindex="-1">\u4EFB\u52A1\u961F\u5217 <a class="header-anchor" href="#\u4EFB\u52A1\u961F\u5217" aria-hidden="true">#</a></h3><p>\u6240\u6709\u7684\u4EFB\u52A1\u53EF\u4EE5\u5206\u4E3A\u540C\u6B65\u4EFB\u52A1\u548C\u5F02\u6B65\u4EFB\u52A1\uFF0C\u540C\u6B65\u4EFB\u52A1\uFF0C\u987E\u540D\u601D\u4E49\uFF0C\u5C31\u662F\u7ACB\u5373\u6267\u884C\u7684\u4EFB\u52A1\uFF0C\u540C\u6B65\u4EFB\u52A1\u4E00\u822C\u4F1A\u76F4\u63A5\u8FDB\u5165\u5230\u4E3B\u7EBF\u7A0B\u4E2D\u6267\u884C\uFF1B\u800C\u5F02\u6B65\u4EFB\u52A1\uFF0C\u5C31\u662F\u5F02\u6B65\u6267\u884C\u7684\u4EFB\u52A1\uFF0C\u6BD4\u5982 ajax \u7F51\u7EDC\u8BF7\u6C42\uFF0CsetTimeout \u5B9A\u65F6\u51FD\u6570\u7B49\u90FD\u5C5E\u4E8E\u5F02\u6B65\u4EFB\u52A1\uFF0C\u5F02\u6B65\u4EFB\u52A1\u4F1A\u901A\u8FC7\u4EFB\u52A1\u961F\u5217( Event Queue )\u7684\u673A\u5236\u6765\u8FDB\u884C\u534F\u8C03\u3002\u5177\u4F53\u7684\u53EF\u4EE5\u7528\u4E0B\u9762\u7684\u56FE\u6765\u5927\u81F4\u8BF4\u660E\u4E00\u4E0B\uFF1A</p><p><img src="https://github.com/hugo1o1/images/blob/master/posts/8.10_1.jpg?raw=true" alt="img"></p><p>\u5728\u4E8B\u4EF6\u5FAA\u73AF\u4E2D\uFF0C\u6BCF\u8FDB\u884C\u4E00\u6B21\u5FAA\u73AF\u64CD\u4F5C\u79F0\u4E3A tick\uFF0C\u901A\u8FC7\u9605\u8BFB\u89C4\u8303\u53EF\u77E5\uFF0C\u6BCF\u4E00\u6B21 tick \u7684\u4EFB\u52A1\u5904\u7406\u6A21\u578B\u662F\u6BD4\u8F83\u590D\u6742\u7684\uFF0C\u5176\u5173\u952E\u7684\u6B65\u9AA4\u53EF\u4EE5\u603B\u7ED3\u5982\u4E0B\uFF1A</p><ol><li>\u5728\u6B64\u6B21 tick \u4E2D\u9009\u62E9\u6700\u5148\u8FDB\u5165\u961F\u5217\u7684\u4EFB\u52A1( oldest task )\uFF0C\u5982\u679C\u6709\u5219\u6267\u884C(\u4E00\u6B21)</li><li>\u68C0\u67E5\u662F\u5426\u5B58\u5728 Microtasks \uFF0C\u5982\u679C\u5B58\u5728\u5219\u4E0D\u505C\u5730\u6267\u884C\uFF0C\u76F4\u81F3\u6E05\u7A7A Microtask Queue</li><li>\u66F4\u65B0 render</li><li>\u4E3B\u7EBF\u7A0B\u91CD\u590D\u6267\u884C\u4E0A\u8FF0\u6B65\u9AA4</li></ol><p>\u53EF\u4EE5\u7528\u4E00\u5F20\u56FE\u6765\u8BF4\u660E\u4E0B\u6D41\u7A0B\uFF1A <img src="https://github.com/hugo1o1/images/blob/master/posts/8.10_2.jpg?raw=true" alt="img"></p><p>\u8FD9\u91CC\u76F8\u4FE1\u6709\u4EBA\u4F1A\u60F3\u95EE\uFF0C\u4EC0\u4E48\u662F microtasks ?\u89C4\u8303\u4E2D\u89C4\u5B9A\uFF0Ctask \u5206\u4E3A\u4E24\u5927\u7C7B, \u5206\u522B\u662F Macro Task \uFF08\u5B8F\u4EFB\u52A1\uFF09\u548C Micro Task\uFF08\u5FAE\u4EFB\u52A1\uFF09, \u5E76\u4E14\u6BCF\u4E2A\u5B8F\u4EFB\u52A1\u7ED3\u675F\u540E, \u90FD\u8981\u6E05\u7A7A\u6240\u6709\u7684\u5FAE\u4EFB\u52A1,\u8FD9\u91CC\u7684 Macro Task \u4E5F\u662F\u6211\u4EEC\u5E38\u8BF4\u7684 task \uFF0C\u6709\u4E9B\u6587\u7AE0\u5E76\u6CA1\u6709\u5BF9\u5176\u505A\u533A\u5206\uFF0C\u540E\u9762\u6587\u7AE0\u4E2D\u6240\u63D0\u53CA\u7684 task \u7686\u770B\u505A\u5B8F\u4EFB\u52A1( macro task)\u3002</p><p>(macro)task \u4E3B\u8981\u5305\u542B\uFF1Ascript( \u6574\u4F53\u4EE3\u7801)\u3001setTimeout\u3001setInterval\u3001I/O\u3001UI \u4EA4\u4E92\u4E8B\u4EF6\u3001setImmediate(Node.js \u73AF\u5883)</p><p>microtask \u4E3B\u8981\u5305\u542B\uFF1APromise\u3001MutaionObserver\u3001process.nextTick(Node.js \u73AF\u5883)</p><p>setTimeout/Promise \u7B49 API \u4FBF\u662F\u4EFB\u52A1\u6E90\uFF0C\u800C\u8FDB\u5165\u4EFB\u52A1\u961F\u5217\u7684\u662F\u7531\u4ED6\u4EEC\u6307\u5B9A\u7684\u5177\u4F53\u6267\u884C\u4EFB\u52A1\u3002\u6765\u81EA\u4E0D\u540C\u4EFB\u52A1\u6E90\u7684\u4EFB\u52A1\u4F1A\u8FDB\u5165\u5230\u4E0D\u540C\u7684\u4EFB\u52A1\u961F\u5217\u3002\u5176\u4E2D setTimeout \u4E0E setInterval \u662F\u540C\u6E90\u7684\u3002</p><h3 id="\u5206\u6790\u793A\u4F8B\u4EE3\u7801" tabindex="-1">\u5206\u6790\u793A\u4F8B\u4EE3\u7801 <a class="header-anchor" href="#\u5206\u6790\u793A\u4F8B\u4EE3\u7801" aria-hidden="true">#</a></h3><p>\u5343\u8A00\u4E07\u8BED\uFF0C\u4E0D\u5982\u5C31\u7740\u4F8B\u5B50\u8BB2\u6765\u7684\u6E05\u695A\u3002\u4E0B\u9762\u6211\u4EEC\u53EF\u4EE5\u6309\u7167\u89C4\u8303\uFF0C\u4E00\u6B65\u6B65\u6267\u884C\u89E3\u6790\u4E0B\u4E0A\u9762\u7684\u4F8B\u5B50\uFF0C\u5148\u8D34\u4E00\u4E0B\u4F8B\u5B50\u4EE3\u7801\uFF08\u514D\u5F97\u4F60\u5F80\u4E0A\u7FFB\uFF09\u3002</p><div class="language-"><pre><code>console.log(&#39;script start&#39;);

setTimeout(function() {
  console.log(&#39;setTimeout&#39;);
}, 0);

Promise.resolve().then(function() {
  console.log(&#39;promise1&#39;);
}).then(function() {
  console.log(&#39;promise2&#39;);
});

console.log(&#39;script end&#39;);
</code></pre></div><ol><li>\u6574\u4F53 script \u4F5C\u4E3A\u7B2C\u4E00\u4E2A\u5B8F\u4EFB\u52A1\u8FDB\u5165\u4E3B\u7EBF\u7A0B\uFF0C\u9047\u5230 console.log\uFF0C\u8F93\u51FA script start</li><li>\u9047\u5230 setTimeout\uFF0C\u5176\u56DE\u8C03\u51FD\u6570\u88AB\u5206\u53D1\u5230\u5B8F\u4EFB\u52A1 Event Queue \u4E2D</li><li>\u9047\u5230 Promise\uFF0C\u5176 then \u51FD\u6570\u88AB\u5206\u5230\u5230\u5FAE\u4EFB\u52A1 Event Queue \u4E2D,\u8BB0\u4E3A then1\uFF0C\u4E4B\u540E\u53C8\u9047\u5230\u4E86 then \u51FD\u6570\uFF0C\u5C06\u5176\u5206\u5230\u5FAE\u4EFB\u52A1 Event Queue \u4E2D\uFF0C\u8BB0\u4E3A then2</li><li>\u9047\u5230 console.log\uFF0C\u8F93\u51FA script end</li></ol><p>\u81F3\u6B64\uFF0CEvent Queue \u4E2D\u5B58\u5728\u4E09\u4E2A\u4EFB\u52A1\uFF0C\u5982\u4E0B\u8868\uFF1A</p><table><thead><tr><th>\u5B8F\u4EFB\u52A1</th><th>\u5FAE\u4EFB\u52A1</th></tr></thead><tbody><tr><td>setTimeout</td><td>then1</td></tr><tr><td>-</td><td>then2</td></tr></tbody></table><ol><li>\u6267\u884C\u5FAE\u4EFB\u52A1\uFF0C\u9996\u5148\u6267\u884C then1\uFF0C\u8F93\u51FA promise1, \u7136\u540E\u6267\u884C then2\uFF0C\u8F93\u51FA promise2\uFF0C\u8FD9\u6837\u5C31\u6E05\u7A7A\u4E86\u6240\u6709\u5FAE\u4EFB\u52A1</li><li>\u6267\u884C setTimeout \u4EFB\u52A1\uFF0C\u8F93\u51FA setTimeout \u81F3\u6B64\uFF0C\u8F93\u51FA\u7684\u987A\u5E8F\u662F\uFF1Ascript start, script end, promise1, promise2, setTimeout</li></ol><p>so\uFF0C\u4F60\u731C\u5BF9\u4E86\u5417\uFF1F</p><p>\u770B\u770B\u4F60\u638C\u63E1\u4E86\u6CA1</p><p>\u518D\u6765\u4E00\u4E2A\u9898\u76EE\uFF0C\u6765\u505A\u4E2A\u7EC3\u4E60\uFF1A</p><div class="language-"><pre><code>console.log(&#39;script start&#39;);

setTimeout(function() {
  console.log(&#39;timeout1&#39;);
}, 10);

new Promise(resolve =&gt; {
    console.log(&#39;promise1&#39;);
    resolve();
    setTimeout(() =&gt; console.log(&#39;timeout2&#39;), 10);
}).then(function() {
    console.log(&#39;then1&#39;)
})

console.log(&#39;script end&#39;);
</code></pre></div><p>\u8FD9\u4E2A\u9898\u76EE\u5C31\u7A0D\u5FAE\u6709\u70B9\u590D\u6742\u4E86\uFF0C\u6211\u4EEC\u518D\u5206\u6790\u4E0B\uFF1A</p><p>\u9996\u5148\uFF0C\u4E8B\u4EF6\u5FAA\u73AF\u4ECE\u5B8F\u4EFB\u52A1 (macrotask) \u961F\u5217\u5F00\u59CB\uFF0C\u6700\u521D\u59CB\uFF0C\u5B8F\u4EFB\u52A1\u961F\u5217\u4E2D\uFF0C\u53EA\u6709\u4E00\u4E2A scrip t(\u6574\u4F53\u4EE3\u7801)\u4EFB\u52A1\uFF1B\u5F53\u9047\u5230\u4EFB\u52A1\u6E90 (task source) \u65F6\uFF0C\u5219\u4F1A\u5148\u5206\u53D1\u4EFB\u52A1\u5230\u5BF9\u5E94\u7684\u4EFB\u52A1\u961F\u5217\u4E2D\u53BB\u3002\u6240\u4EE5\uFF0C\u5C31\u548C\u4E0A\u9762\u4F8B\u5B50\u7C7B\u4F3C\uFF0C\u9996\u5148\u9047\u5230\u4E86 console.log\uFF0C\u8F93\u51FA script start\uFF1B \u63A5\u7740\u5F80\u4E0B\u8D70\uFF0C\u9047\u5230 setTimeout \u4EFB\u52A1\u6E90\uFF0C\u5C06\u5176\u5206\u53D1\u5230\u4EFB\u52A1\u961F\u5217\u4E2D\u53BB\uFF0C\u8BB0\u4E3A timeout1\uFF1B \u63A5\u7740\u9047\u5230 promise\uFF0Cnew promise \u4E2D\u7684\u4EE3\u7801\u7ACB\u5373\u6267\u884C\uFF0C\u8F93\u51FA promise1, \u7136\u540E\u6267\u884C resolve ,\u9047\u5230 setTimeout ,\u5C06\u5176\u5206\u53D1\u5230\u4EFB\u52A1\u961F\u5217\u4E2D\u53BB\uFF0C\u8BB0\u4E3A timemout2, \u5C06\u5176 then \u5206\u53D1\u5230\u5FAE\u4EFB\u52A1\u961F\u5217\u4E2D\u53BB\uFF0C\u8BB0\u4E3A then1\uFF1B \u63A5\u7740\u9047\u5230 console.log \u4EE3\u7801\uFF0C\u76F4\u63A5\u8F93\u51FA script end \u63A5\u7740\u68C0\u67E5\u5FAE\u4EFB\u52A1\u961F\u5217\uFF0C\u53D1\u73B0\u6709\u4E2A then1 \u5FAE\u4EFB\u52A1\uFF0C\u6267\u884C\uFF0C\u8F93\u51FA then1 \u518D\u68C0\u67E5\u5FAE\u4EFB\u52A1\u961F\u5217\uFF0C\u53D1\u73B0\u5DF2\u7ECF\u6E05\u7A7A\uFF0C\u5219\u5F00\u59CB\u68C0\u67E5\u5B8F\u4EFB\u52A1\u961F\u5217\uFF0C\u6267\u884C timeout1,\u8F93\u51FA timeout1\uFF1B \u63A5\u7740\u6267\u884C timeout2\uFF0C\u8F93\u51FA timeout2 \u81F3\u6B64\uFF0C\u6240\u6709\u7684\u90FD\u961F\u5217\u90FD\u5DF2\u6E05\u7A7A\uFF0C\u6267\u884C\u5B8C\u6BD5\u3002\u5176\u8F93\u51FA\u7684\u987A\u5E8F\u4F9D\u6B21\u662F\uFF1Ascript start, promise1, script end, then1, timeout1, timeout2</p><p>\u7528\u6D41\u7A0B\u56FE\u770B\u66F4\u6E05\u6670\uFF1A</p><p><img src="https://github.com/hugo1o1/images/blob/master/posts/8.10_3.jpg?raw=true" alt="img"></p><h3 id="\u603B\u7ED3" tabindex="-1">\u603B\u7ED3 <a class="header-anchor" href="#\u603B\u7ED3" aria-hidden="true">#</a></h3><p>\u6709\u4E2A\u5C0F tip\uFF1A\u4ECE\u89C4\u8303\u6765\u770B\uFF0Cmicrotask \u4F18\u5148\u4E8E task \u6267\u884C\uFF0C\u6240\u4EE5\u5982\u679C\u6709\u9700\u8981\u4F18\u5148\u6267\u884C\u7684\u903B\u8F91\uFF0C\u653E\u5165 microtask \u961F\u5217\u4F1A\u6BD4 task \u66F4\u65E9\u7684\u88AB\u6267\u884C\u3002</p><p>\u6700\u540E\u7684\u6700\u540E\uFF0C\u8BB0\u4F4F\uFF0C<strong>JavaScript \u662F\u4E00\u95E8\u5355\u7EBF\u7A0B\u8BED\u8A00\uFF0C\u5F02\u6B65\u64CD\u4F5C\u90FD\u662F\u653E\u5230\u4E8B\u4EF6\u5FAA\u73AF\u961F\u5217\u91CC\u9762\uFF0C\u7B49\u5F85\u4E3B\u6267\u884C\u6808\u6765\u6267\u884C\u7684\uFF0C\u5E76\u6CA1\u6709\u4E13\u95E8\u7684\u5F02\u6B65\u6267\u884C\u7EBF\u7A0B\u3002</strong>\u3002</p>`,38),p=[e];function c(i,l,u,r,k,m){return t(),s("div",null,p)}var h=n(o,[["render",c]]);export{g as __pageData,h as default};
